import { useState } from 'react';
import './App.css';
//import React, {useState, useEffect} from 'react';
import {Home, SingleProfilePage, SignInSignUpPage} from './pages';
import { Route, Routes } from "react-router-dom";

export const Context = React.createContext();

function App() {


  const [UserDetailsContext, setUserDetailsContext] = useState({
    'accessToken': '',
    'email': '',
    'loginAs': '',
    'phoneNumber': '',
    'userName': '',
    '_id': ''
  })

  return (
    <Routes>
      <Route path="/" element={<SignInSignUpPage />} />
      <Route path="/Home" element={<Home />} />
      <Route path="/SingleProfile/:id" element={<SingleProfilePage/>} />
    </Routes>



    // <div>
    //   <Home/>
    // </div>
  );
}
export default App;
